from native_object import *

def test_controller_config():
    cfg = ControllerConfig(config)
    packed_cfg = cfg.pack()
    print(packed_cfg)

#    packed_cfg = bytes.fromhex('')
#    print(packed_cfg)
    cfg2 = ControllerConfig.unpack(packed_cfg)
    print(cfg2)

    assert cfg == cfg2

test_controller_config()

